import React, { useEffect } from 'react'
import styled from 'styled-components'

type ContainerProps = {
  className: string
}
type ComponentProps = {} & ContainerProps
// type TestFuncTypes = () => Promise<void>

const Component: React.FC<ComponentProps> = props => (
  <div className={props.className} />
)

const StyledComponent = styled(Component)``

const Container: React.FC<ContainerProps> = props => {
  const getTitle = async (): string => {
    const key = {
      headers: { 'X-API-KEY': '424e3496-6cb7-4ebd-8572-49b5a148e90f' }
    }

    const res = await fetch('https://nepota.microcms.io/api/v1/blog', key)
    const repos = await res.json()

    return repos.contents[1].title
  }

  console.log(getTitle())

  return <StyledComponent {...props} />
}

export default Container
